import React from "react";
import styled from "styled-components";
function Register() {
  return (
    <>
      <FormContainer>
        <form onSubmit={(event) => hadnleSubmit(event)}></form>
      </FormContainer>
    </>
  );
}

const FormContainer = styled.div``;

export default Register;
